import React from "react";
import { useParams } from "react-router-dom";
import { getItem } from "../libs/getItems";
import { getProduct } from "../libs/getItems";
import { Model } from "../libs/productGallery";

export default function ProductRender() {
  const id = useParams();
  const data = getItem(id._id);
  const model = data.modele.map((item) => {
    return (
      <div>
        <li>{item.name}</li>
      </div>
    );
  });
  console.log(data);

  return (
    <div>
      bonjour <br />
      {data.title} <br />
      {model}
      <Model data={data} />
    </div>
  );
}

export function ModelRender() {
  const id = useParams();
  const dataModel = getProduct(id._id).modele;
  console.log(dataModel);
  return <div>bonjour {dataModel[0].name}</div>;
}
